import Container from "../components/container";
import Header from "../components/header";
import UserContainer from "../components/userContainer";
import UserPicture from "../components/userPic";
import UserDetails from "../components/userDetails";
import UserNamber from "../components/UserNumbers";
import react, { useContext } from "react";

import { context } from "../context";

export default function Home() {
    const ctx = useContext(context);
    return (
        <Container>
            <Header />
            <UserContainer>
                <UserPicture
                    url={ctx.userData?.avatar_url}
                    alternativeText={ctx.useData?.login}
                />
                <UserDetails
                    name="JoÃ£o Vitor Onofre"
                    login="#joaovitoronofre"
                    bio="taskasjak"
                ></UserDetails>
                <UserNamber></UserNamber>
            </UserContainer>
        </Container>
    );
}
